  faCss3Alt,
  faHtml5,
  faJs,
  faNode,
  faReact,
} from "@fortawesome/free-brands-svg-icons";
import './experience.css';
const Skills = ({ darkMode }) => {
  return (
    <>
   <a class="anchor" id="top"></a>
