                </Card.Body>
              </Card> */}
              <div>
              <h1 className="lead" align="center">
             <b>- Skill Sets -</b>
           </h1>
           <br></br>
  <h3 style={{color:"white"}}>ReactJS</h3>
  <ProgressBar variant="success" animated now={95} /><br/>
