  <ProgressBar variant="success" animated now={95} /><br/>
  <h3 style={{color:"white"}}>Bootstrap</h3>
  <ProgressBar variant="success" animated now={95} />

</div>
            </Col>
          </Row>
          <br></br>
        </Container>
      </Slide>
    </div>
    <hr></hr>
    </>
  );
};

export default Skills;
